import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input to be visible and enter 'team'
    await page.waitForSelector('#eventSearchInput');
    await page.fill('#eventSearchInput', 'team');

    // Take a screenshot after entering the search term
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input.png'));

    // Wait for the search button to be visible and click it
    await page.waitForSelector('.search-btn');
    await page.click('.search-btn');

    // Wait for the results to load (you may need to adjust this based on the actual loading behavior)
    await page.waitForLoadState('networkidle');

    // Take a screenshot of the results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract meaningful data to verify task completion (for example, count events found)
    const eventsFound = await page.$$eval('.event-item', items => items.length);

    return {
      success: true,
      action: "Searched for team-related events successfully",
      extractedData: { eventsFound },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

