import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input to be available and type 'team'
    await page.waitForSelector('#eventSearchInput');
    await page.fill('#eventSearchInput', 'team');

    // Take screenshot after entering search term
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_input_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_input_filled.png'));

    // Wait for the search button to be clickable and click it
    await page.waitForSelector('.search-btn');
    await page.click('.search-btn');

    // Take screenshot after clicking search
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_button_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_button_clicked.png'));

    // Wait for results to load (assuming results appear in a specific container)
    await page.waitForSelector('.event-results', { timeout: 5000 });

    // Extract some meaningful data to verify task completion
    const results = await page.$$eval('.event-results .event-item', items => 
      items.map(item => ({
        title: item.querySelector('.event-title')?.innerText,
        date: item.querySelector('.event-date')?.innerText
      }))
    );

    return {
      success: true,
      action: "Searched for team events successfully",
      extractedData: { results },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
